// AccountPage.js
import React, { useState, useEffect } from 'react';
import api from '../../api';
import { useNavigate } from 'react-router-dom';
import SubsComponent from '../subscriptions/SubsComponent';
import UserWorkouts from '../workouts/UserWorkouts';
import { Box, Button, Typography, Card, CardContent, Stack } from '@mui/material';
import EmailIcon from '@mui/icons-material/Email';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import EventAvailableIcon from '@mui/icons-material/EventAvailable';
import EditIcon from '@mui/icons-material/Edit'


const AccountPage = () => {

  const [userData, setUserData] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [modalMessage, setModalMessage] = useState('');
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');


  const navigate = useNavigate();

  useEffect(() => {

    api.get('/user/data')
      .then(response => {
        setUserData(response.data);
      })
      .catch(error => {
        console.error('Error fetching user data:', error);
        setError("Account not found");
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);

  const handleDeleteAccount = () => {
    if (window.confirm('Are you sure you want to delete your account?')) {

      const userId = userData && userData.user_id;

      if (userId) {

        api.delete(`/subscription/delete/${userId}`)
          .then(() => {
            return api.delete(`/delete/${userId}`);
          })
          .then(response => {
            localStorage.clear();
            setModalMessage('Account deleted successfully');
            setShowModal(true);
            navigate('/home');
          })
          .catch(error => {
            console.error('Error deleting account:', error);
          });
      }
    };
  }
  const handleLogoutAccount = () => {
    localStorage.setItem('logoutNotification', 'true');
    localStorage.clear();
    setModalMessage('Logout successfully');
    setShowModal(true);

  };



  if (!userData || loading) {
    return (
      <div>
        {error}
      </div>

    );
  }

  return (
    <Box p={10} display={'flex'} justifyContent={'center'} alignItems={'center'}>

      {userData && (
        <Box> 
          <Card sx={{ borderRadius: 4, mb: 2, position: 'relative', width: 400 }}>
            <EditIcon sx={{position: 'relative', left: 10}}></EditIcon>
            <CardContent>
              <Typography variant="h6">User Profile</Typography>
              <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                <AccountCircleIcon sx={{ mr: 1 }} />
                <Typography>Name:</Typography>
                <Typography sx={{ ml: 1 }}>{userData.user_name}</Typography>
              </Box>
              <Box sx={{ display: 'flex', alignItems: 'center', mb: 1 }}>
                <EmailIcon sx={{ mr: 1 }} />
                <Typography>Email:</Typography>
                <Typography sx={{ ml: 1 }}>{userData.user_email}</Typography>
              </Box>
              <Box sx={{ display: 'flex', alignItems: 'center' }}>
                <EventAvailableIcon sx={{ mr: 1 }} />
                <Typography>Last workout check:</Typography>
                <Typography sx={{ ml: 1 }}>{userData.last_check}</Typography>
              </Box>
            </CardContent>
          </Card>
          <Stack direction="row" spacing={2}>
            <Button variant='outlined' onClick={handleDeleteAccount}>Delete account</Button>
            <Button variant='outlined' color='error' onClick={handleLogoutAccount}>Logout</Button>
          </Stack>
        </Box>
      )}
    </Box>
  );
};

export default AccountPage;
